import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  Button,
  CircularProgress,
  TextField,
  Select,
  MenuItem,
  InputLabel,
  FormControl,
  FormHelperText,
  Box,
} from '@mui/material';
import { green, red, yellow } from '@mui/material/colors';

function App() {
  const [status, setStatus] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [preferredEnergySource, setPreferredEnergySource] = useState('');
  const [preferredTime, setPreferredTime] = useState('');

  useEffect(() => {
    axios.get('http://localhost:5000/api/status')
      .then((response) => {
        setStatus(response.data);
        setLoading(false);
      })
      .catch((error) => {
        setError('Erro ao carregar os dados');
        setLoading(false);
      });
  }, []);

  const handleEnergySourceChange = (event) => {
    setPreferredEnergySource(event.target.value);
  };

  const handleTimeChange = (event) => {
    setPreferredTime(event.target.value);
  };

  // Função para determinar a cor do status com base no status do veículo
  const getStatusColor = (status) => {
    switch (status) {
      case 'Carregando':
        return green[500];
      case 'Concluído':
        return yellow[700];
      case 'Erro':
        return red[500];
      default:
        return 'gray';
    }
  };

  return (
    <Container maxWidth="lg">
      <Typography variant="h3" gutterBottom align="center" color="primary">
        Monitoramento de Recarga de Veículos Elétricos
      </Typography>

      {loading ? (
        <CircularProgress color="primary" />
      ) : error ? (
        <Typography color="error" align="center">
          {error}
        </Typography>
      ) : (
        <Grid container spacing={3} justifyContent="center">
          {status.map((veiculo, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <Card variant="outlined">
                <CardContent>
                  <Typography variant="h5" component="div" color="primary">
                    {veiculo.nome}
                  </Typography>
                  <Typography variant="body2" color={getStatusColor(veiculo.status)}>
                    Status: {veiculo.status}
                  </Typography>
                  <Typography color="textSecondary">
                    Fonte de Energia: {veiculo.fonteEnergia}
                  </Typography>
                  <Typography color="textSecondary">
                    Hora de Início: {veiculo.horaInicio}
                  </Typography>
                  <Button variant="contained" color="primary" fullWidth>
                    Detalhes
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      )}

      {/* Seção para Personalização */}
      <Box mt={5} textAlign="center">
        <Typography variant="h5" gutterBottom>
          Personalizar Preferências de Carregamento
        </Typography>

        <Grid container spacing={3} justifyContent="center">
          <Grid item xs={12} sm={6} md={4}>
            <FormControl fullWidth>
              <InputLabel>Fonte de Energia</InputLabel>
              <Select
                value={preferredEnergySource}
                onChange={handleEnergySourceChange}
                label="Fonte de Energia"
              >
                <MenuItem value="solar">Solar</MenuItem>
                <MenuItem value="eolica">Eólica</MenuItem>
                <MenuItem value="hidraulica">Hidráulica</MenuItem>
                <MenuItem value="convencional">Convencional</MenuItem>
              </Select>
              <FormHelperText>Escolha uma fonte renovável ou convencional</FormHelperText>
            </FormControl>
          </Grid>

          <Grid item xs={12} sm={6} md={4}>
            <TextField
              fullWidth
              label="Horário Preferencial"
              type="time"
              value={preferredTime}
              onChange={handleTimeChange}
              InputLabelProps={{
                shrink: true,
              }}
            />
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}

export default App;
